import React from 'react'

import moon from '../img/moon.jpg'

const styles = {
  container: {
    height: 1356,
    backgroundImage: url(`${img/moon.jpg}`)
  }
}

export default class Home extends React.Component {

  render() {
    return (
      <div style={styles.container}>
      </div>
    )
  }
}
